import React from 'react';
import { useTranslation } from 'react-i18next';
import { 
  Palette, 
  Brush, 
  Layout, 
  Camera, 
  Video, 
  Smartphone,
  ArrowLeft,
  CheckCircle,
  Eye,
  Sparkles,
  Zap
} from 'lucide-react';
import { useNavigate } from 'react-router-dom';
import './DesignPage.css';

const DesignPage = () => {
  const { t } = useTranslation();
  const navigate = useNavigate();

  const designServices = [
    {
      icon: <Layout size={32} />,
      title: t('uiuxDesign'),
      description: t('uiuxDesignDesc'),
      features: [
        t('userResearch'),
        t('wireframing'),
        t('prototyping'),
        t('usabilityTesting')
      ]
    },
    {
      icon: <Brush size={32} />,
      title: t('brandingDesign'),
      description: t('brandingDesignDesc'),
      features: [
        t('logoDesign'),
        t('brandIdentity'),
        t('colorPalettes'),
        t('brandGuidelines')
      ]
    },
    {
      icon: <Camera size={32} />,
      title: t('graphicDesign'),
      description: t('graphicDesignDesc'),
      features: [
        t('printDesign'),
        t('digitalAssets'),
        t('illustrations'),
        t('infographics')
      ]
    },
  ];

  const designTools = [
    'Figma', 'Adobe XD', 'Photoshop', 'Illustrator', 'After Effects', 'Sketch',
    'InVision', 'Principle', 'Framer', 'Canva', 'Procreate', 'Blender'
  ];

  const designProcess = [
    {
      step: '01',
      title: t('discovery'),
      description: t('discoveryDesc'),
      icon: <Eye size={24} />
    },
    {
      step: '02',
      title: t('conceptualization'),
      description: t('conceptualizationDesc'),
      icon: <Sparkles size={24} />
    },
    {
      step: '03',
      title: t('design'),
      description: t('designDesc'),
      icon: <Brush size={24} />
    },
    {
      step: '04',
      title: t('refinement'),
      description: t('refinementDesc'),
      icon: <Zap size={24} />
    }
  ];

  return (
    <div className="design-page">
      {/* Header Section */}
      <div className="design-header">
        <button 
          className="back-button"
          onClick={() => navigate(-1)}
        >
          <ArrowLeft size={20} />
          {t('back')}
        </button>
        
        <div className="design-hero">
          <div className="hero-icon">
            <Palette size={48} />
          </div>
          <h1>{t('designCreativityServices')}</h1>
          <p className="hero-subtitle">{t('designHeroDesc')}</p>
        </div>
      </div>

      {/* Services Grid */}
      <section className="design-services-section">
        <div className="container">
          <h2>{t('ourDesignServices')}</h2>
          <div className="design-services-grid">
            {designServices.map((service, index) => (
              <div key={index} className="design-service-card">
                <div className="service-icon">{service.icon}</div>
                <h3>{service.title}</h3>
                <p>{service.description}</p>
                <ul className="features-list">
                  {service.features.map((feature, idx) => (
                    <li key={idx}>
                      <CheckCircle size={16} />
                      <span>{feature}</span>
                    </li>
                  ))}
                </ul>
                <button className="learn-more-btn">{t('viewPortfolio')}</button>
              </div>
            ))}
          </div>
        </div>
      </section>

      {/* Design Process Section */}
      <section className="design-process-section">
        <div className="container">
          <h2>{t('ourDesignProcess')}</h2>
          <div className="process-grid">
            {designProcess.map((step, index) => (
              <div key={index} className="process-step">
                <div className="step-number">{step.step}</div>
                <div className="step-icon">{step.icon}</div>
                <h3>{step.title}</h3>
                <p>{step.description}</p>
              </div>
            ))}
          </div>
        </div>
      </section>

      {/* Tools Section */}
      <section className="design-tools-section">
        <div className="container">
          <h2>{t('designToolsWeUse')}</h2>
          <div className="tools-grid">
            {designTools.map((tool, index) => (
              <div key={index} className="tool-tag">
                <Palette size={16} />
                {tool}
              </div>
            ))}
          </div>
        </div>
      </section>
    </div>
  );
};

export default DesignPage;
